import React from 'react';
import classes from './Events.css'



const event=(props) =>{
    let name= props.name;
    let owner = props.owner;
    let OrgId = props.OrgId;


    return(
        <div className="col-md-6 col-lg-4 col-xl-3">
          <figure className="snip1527" >
            <div className="image"><img src={require("./new_img.jpg")} /></div>
            <figcaption>
              <div className="date"><span className="day">GO</span><span className="month">FUND!</span></div>
              <h3>NAME: {name}</h3>
              <h3>OWNER: {owner}</h3>
              <h3>Organization ID :{OrgId}</h3>
            </figcaption>
            <a ></a>
          </figure>
        </div>
        );
}

export default event;
